  "continuation": "reina y señora de las otras flores!\nNo hay en la tierra rosa como Rosa,\nni estrella como Sol, ni luz hermosa\ncual la que riela en tus azules mares.\n¡Quien te vio y no te amó? ¿Quién tus altares\nno regó con sus lágrimas piadosas?"
